import React, {useState} from 'react'
import {Link} from "react-router-dom";

export default function RegisterPage() {

    function RegisterError() {
        const [registerError, setRegisterError] = useState(0)

        function validateFunction() {
            console.log(registerError);
            setRegisterError(registerError + 1)
        }

        // if (document.getElementById("email").innerText === "" || document.getElementById("username").innerText === "" || document.getElementById("password").innerText === "")
        // {
        //     if (document.getElementById("email").innerText === "")
        //     {
        //         setRegisterError("please enter an email");
        //     }
        //     else if(document.getElementById("username").innerText === "")
        //     {
        //         setRegisterError("please enter a user name");
        //     }
        //     else
        //     {
        //         registerError("please enter a password");
        //     }
        // }

        return (
            <div>
                <form id="registerpanel">
                    <h1 id="litheader">Register</h1>
                    <div className="inset">
                        <p>
                            <input type="text" name="email" id="email" placeholder="Email"/>
                        </p>
                        <p>
                            <input type="text" name="username" id="username" placeholder="User Name"/>
                        </p>
                        <p>
                            <input type="password" name="password" id="password" placeholder="Password"/>
                        </p>
                    </div>
                    <div className="p-container" id="registerError">{registerError}</div>
                    <p className="p-container">
                        <Link to='/login'>
                            <button onClick={validateFunction}>Register</button>
                        </Link>
                    </p>
                </form>
            </div>
        )
    }
}
